import { __decorate } from "tslib";
import { Component } from '@angular/core';
import { Userdata } from "../models/userdata";
let LoginComponent = class LoginComponent {
    constructor(_userService) {
        this._userService = _userService;
        this.UserModel = new Userdata("Ayan", "ayan@gmail.com", 123, "Kolkata", "12345", "12345");
        this.dissable = true;
        this.succMsg = false;
        this.errMsg = false;
    }
    ngOnInit() {
    }
    async doRegister() {
        let self = this;
        this._userService.doRegister(this.UserModel).subscribe({
            next: (data) => {
                this.succMsg = data.message;
                self.errMsg = false;
            },
            error(error) {
                if (error.error.message) {
                    self.errMsg = error.error.message;
                }
                else {
                    self.errMsg = error.statusText;
                }
                self.succMsg = false;
            },
            complete() {
                console.log("Process is done");
            }
        });
    }
};
LoginComponent = __decorate([
    Component({
        selector: 'app-login',
        templateUrl: './login.component.html',
        styleUrls: ['./login.component.scss']
    })
], LoginComponent);
export { LoginComponent };
